───────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m (3): name, normalized_name, gender\n","\u001b[32mdbl\u001b[39m (1): id\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]}],"source":["total_episodes = length(id)\n","total_episodes\n","characters <- read_csv(paste(data_fp,\"simpsons_characters.csv\", sep=\"\"))\n","\n","##Bart Episode Views\n","viewers_by_bart = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS bart_episode_title,\n","                              imdb_rating AS bart_rate\n","                             FROM episodes\n","                            WHERE title LIKE '%bart%'\n","                              OR title LIKE '%Bart%' \n","                              OR title LIKE '% barts %'\n","                              OR title LIKE '% barts%'\n","                              OR title LIKE '% Bart%' \n","                          \")\n","\n","\n","##Homer\n","viewers_by_homer = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS homer_episode_title,\n","                              imdb_rating AS homer_rate\n","                             FROM episodes\n","                            WHERE title LIKE '%homer%'\n","                              OR title LIKE '%Homer%' \n","                              OR title LIKE '% homers %'\n","                              OR title LIKE '% homers%'\n","                              OR title LIKE '% Homer%' \n","                          \")\n","\n","\n","##Lisa\n","viewers_by_lisa = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS lisa_episode_title,\n","                              imdb_rating AS lisa_rate\n","                             FROM episodes\n","                            WHERE title LIKE '%lisa%'\n","                              OR title LIKE '%Lisa%' \n","                              OR title LIKE '% lisas %'\n","                              OR title LIKE '% lisas%'\n","                              OR title LIKE '% Lisa%' \n","                          \")\n","\n","\n","\n","\n","##Marge\n","viewers_by_marge = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS marge_episode_title,\n","                              imdb_rating AS marge_rate\n","                             FROM episodes\n","                            WHERE title LIKE '%marge%'\n","                              OR title LIKE '%Marge%' \n","                              OR title LIKE '% Marges %'\n","                              OR title LIKE '% marges%'\n","                              OR title LIKE '% Marge%' \n","                          \")\n","\n","\n","##Burns\n","viewers_by_burns = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS burns_episode_title,\n","                              imdb_rating AS burns_rate\n","                             FROM episodes\n","                            WHERE title LIKE '%burns%'\n","                              OR title LIKE '%Burns%' \n","                              OR title LIKE '% Burnss %'\n","                              OR title LIKE '% burns%'\n","                          \")\n","##Moe\n","viewers_by_moe = sqldf(\"SELECT\n","                            us_viewers_in_millions AS total_char_views,\n","                             title AS moe_episode_title,\n","                              imdb_rating AS moe_rate\n","                             FROM episodes\n","                            WHERE title LIKE